import react from 'react';


const BlogShort = (props) => {

    const { topic, data } = props;


    if (data.length === 0) {

        return (
            <>
                <h1>{topic}</h1>
                <h4>There is no blog found on this topic</h4>

            </>
        )
    }


    return(
    <div className="BlogShort">
    <h1>{topic}</h1>

    </div>
    )
}

export default BlogShort;
